INSERT INTO `kuis-pengetahuan` VALUES ('74', 'Modifier yang memiliki sifat saling kontradiktif yaitu..', 'Final dan Static', 'Akses dan Native', 'Static dan Abstract', 'Storage dan Final', '3', '2020-03-10 14:16:21', '2020-03-10 14:16:21', 'Native dan Abstract');
INSERT INTO `kuis-pengetahuan` VALUES ('75', 'Perhatikan penggalan program berikut ini :\n1.	public class Ceria {\n2.	      public static void main(String args[ ]) {\n3.	            int a = 9; int b = 4; \n4.	            int c= a/b;\n5.	      }\n6.	}\nPendefinisian kelas pada program di atas terjadi pada baris ke...', '1', '2', '3', '4', '1', '2020-03-10 14:16:21', '2020-03-10 14:16:21', '5');
INSERT INTO `kuis-pengetahuan` VALUES ('76', 'Perhatikan penggalan program berikut ini :\n1.	public class Ceria {\n2.	      public static void main(String args[ ]) {\n3.	            int a = 9; int b = 4; \n4.	            int c= a/b;\n5.	      }\n6.	}\nJika nilai variabel c ditampilkan ke layar akan menghasilkan nilai...', '23', '0.10069444444444', '2', '0.085416666666667', '3', '2020-03-10 14:16:21', '2020-03-10 14:16:21', '0.084027777777778');
INSERT INTO `kuis-pengetahuan` VALUES ('77', 'Perhatikan pernyataan dibawah ini:\n1.	Override\n2.	Atribut\n3.	Class\n4.	Overload\n5.	Inheritance\nPernyataan di atas yang termasuk bentuk Polimorfisme adalah…', '1 dan 2', '3 dan 4', '1, 2, dan 3', '1 dan 4', '4', '2020-03-10 14:16:21', '2020-03-10 14:16:21', 'Semua benar');
INSERT INTO `kuis-pengetahuan` VALUES ('78', 'Tipe Polymorphism yang berguna untuk mengetahui tipe asal dari suatu polymorphic arguments…', 'Polymorphic Arguments', 'Casting Objects', 'Intance Of', 'Virtual Method Invocation', '3', '2020-03-10 14:16:21', '2020-03-10 14:16:21', 'Class');
INSERT INTO `kuis-pengetahuan` VALUES ('79', 'Perhatikan source code dibawah ini:\n1.	public class RerataNilai {\n2.	int x1, x2, x3;\n3.	double y1, y2;\n4.	\n5.	public int average(int x1, int x2) {\n6.	rturn (x1+x2)/2;\n7.	}\n8.	publik double average(double y1, double y2) {\n9.	return (y1+y2)/2;\n10.	}\n11.	public int average(int x1, int x2, int x3) {\n12.	return (x1+x2+x3)/3;\n13.	}\n14.	}\n20. Letak kesalahan pada program di atas terjadi pada baris ke..', '11 dan 5', '2 dan 12', '6 dan 8', '8 dan 9', '3', '2020-03-10 14:16:21', '2020-03-10 14:16:21', '5 dan 6');
INSERT INTO `kuis-pengetahuan` VALUES ('80', 'Tipe Polymorphism yang melakukan invocation (pemanggilan) terhadap overriding method pada subclass…', 'Polymorphic Arguments', 'Casting Objects', 'Intance Of', 'Virtual Method Invocation', '4', '2020-03-10 14:16:21', '2020-03-10 14:16:21', 'Class');
INSERT INTO `kuis-pengetahuan` VALUES ('81', 'Berikut adalah beberapa hal yang perlu ditimbangkan pada saat mewariskan method, kecuali…', 'Method yang dideklarasikan public pada superclass harus bersifat public untuk semua subclass', 'Method yang dideklarasikan protected pada superclass dapat menjadi protected/public untuk subclass, namun tidak bisa menjadi private', 'Method yang dideklarasikan tanpa akses(default), tidak dapat dideklarasikan sebagai private untuk subkelas', 'Method yang dideklarasikan private tidak dapat diwariskan', '3', '2020-03-10 14:16:21', '2020-03-10 14:16:21', 'Method yang dideklarasikan tanpa akses(default), tidak dapat dideklarasikan sebagai private untuk superkelas');
INSERT INTO `kuis-pengetahuan` VALUES ('82', 'Salah satu Jenis Polimorfisme yang memiliki ciri nama method harus sama, daftar parameter harus berbeda dan return type yang boleh sama boleh juga tidak bisa dikatakan sebagai…', 'Overriding ', 'Overload', 'Polimorfisme', 'Inheritance', '2', '2020-03-10 14:16:21', '2020-03-10 14:16:21', 'Class');
INSERT INTO `kuis-pengetahuan` VALUES ('83', 'Method yang memiliki nama yang sama dengan nama kelasnya disebut dengan…', 'Overriding ', 'Overload', 'Polimorfisme', 'Inheritance', '5', '2020-03-10 14:16:21', '2020-03-10 14:16:21', 'Class');
INSERT INTO `kuis-pengetahuan` VALUES ('84', 'Untuk mengunci metode info agar tidak dapat di override jika dipanggil pada kelas lain adalah dengan syntax…', 'protected void info( )', 'final void info( )', 'public void info( )', 'private void info( )', '2', '2020-03-10 14:16:21', '2020-03-10 14:16:21', 'private main info( )');
INSERT INTO `kuis-pengetahuan` VALUES ('85', 'Tipe Polymorphism yang menerima suatu nilai yang beripe subclass-nya disebut…', 'Polymorphic Arguments', 'Casting Objects', 'Intance Of', 'Virtual Method Invocation', '1', '2020-03-10 14:16:21', '2020-03-10 14:16:21', 'Class');
INSERT INTO `kuis-pengetahuan` VALUES ('86', 'Kemampuan suatu subkelas untuk memodifikasi data dan method dari kelas induknya disebut dengan…', 'Overriding ', 'Overload', 'Polimorfisme', 'Inheritance', '1', '2020-03-10 14:16:21', '2020-03-10 14:16:21', 'Class');
INSERT INTO `kuis-pengetahuan` VALUES ('87', 'Salah satu konsep penting dalam Object Oriented Programming (OOP) khususnya di bahasa java setelah abstaraction dan inheritance adalah…', 'Superclass', 'Subclass', 'Inheritance', 'Enkapsulasi', '5', '2020-03-10 14:16:21', '2020-03-10 14:16:21', 'Polimorphisme');
INSERT INTO `kuis-pengetahuan` VALUES ('88', 'Method yang bersifat static berarti….', 'Diambil dengan membuat sebuah object dari class tersebut ', 'Dapat mengakses anggota static dan non static dari class ', 'Dapat menunjuk pada this dan super ', 'Dapat diambil tanpa membuat sebuah object dari class tersebut', '4', '2020-03-10 14:16:21', '2020-03-10 14:16:21', 'Dapat menunjuk pada Class');
INSERT INTO `kuis-pengetahuan` VALUES ('89', 'Dalam konsep OOP, setiap object memiliki behaviour. Apa yang dimaksud dengan behaviour adalah…', 'Identifier', 'Variable', 'Method', 'Class', '3', '2020-03-10 14:16:21', '2020-03-10 14:16:21', 'Semua Benar');
INSERT INTO `kuis-pengetahuan` VALUES ('90', 'Classbody terdiri dari…', 'Attribute, constructor, dan method', 'Modifier, constructor, dan method', 'Modifier, Extend, dan Implement', 'Attribute, preveledge, dan Implement', '1', '2020-03-10 14:16:21', '2020-03-10 14:16:21', 'Preveledge, Modifier dan Implement');
INSERT INTO `kuis-pengetahuan` VALUES ('91', 'Kesatuan antara data dan fungsi, disebut…', 'Class', 'Fungsi', 'Variable', 'Method', '5', '2020-03-10 14:16:21', '2020-03-10 14:16:21', 'Obyek');
INSERT INTO `kuis-pengetahuan` VALUES ('92', 'Konsep yang menyatakan sesuatu yang sama dapat memiliki berbagai bentuk dan perilaku berbeda disebut dengan…', 'Overriding ', 'Overload', 'Polimorfisme', 'Inheritance', '4', '2020-03-10 14:16:21', '2020-03-10 14:16:21', 'Constructor');
INSERT INTO `kuis-pengetahuan` VALUES ('93', 'Perhatikan pernyataan dibawah ini:\n1.	Modifier akses\n2.	Modifier static\n3.	Modifier attribute\n4.	Modifier synchronized\n5.	Modifier method\nPernyataan di atas yang termasuk bentuk keyword modifier adalah... ', '1,2 dan 4', '3 dan 4', '1, 2, dan 3', '1 dan 4', '1', '2020-03-10 14:16:21', '2020-03-10 14:16:21', '2, 3 dam 5');
