-- ----------------------------
-- View structure for vw_avg_kelas
-- ----------------------------
DROP VIEW IF EXISTS `vw_avg_kelas`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost`  VIEW `vw_avg_kelas` AS SELECT c.kelas, AVG(a.nilai_max) AS avg_nilai FROM vw_rank_nilai a
INNER JOIN users b
ON a.user_id=b.id
INNER JOIN kelas c
ON b.kelas_id=c.id
GROUP BY b.kelas_id ;

-- ----------------------------
-- View structure for vw_jawaban
-- ----------------------------
DROP VIEW IF EXISTS `vw_jawaban`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `vw_jawaban` AS SELECT b.id,a.user_id,a.`name`, b.jawab, b.detail_score_id,b.`status` FROM vw_rank_nilai a
INNER JOIN score b
ON a.user_id=b.user_id AND b.detail_score_id=a.detail_score_id
ORDER BY b.id ASC ;

-- ----------------------------
-- View structure for vw_rank_nilai
-- ----------------------------
DROP VIEW IF EXISTS `vw_rank_nilai`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `vw_rank_nilai` AS SELECT nt1.user_id,nt1.detail_score_id,nt2.name,nt2.nilai_max FROM vw_score AS nt1
INNER JOIN (
SELECT name,MAX(nilai) AS nilai_max 
FROM vw_score GROUP BY name) AS nt2
ON nt1.name=nt2.name AND nt1.nilai=nt2.nilai_max
GROUP BY nt2.name
ORDER BY nt1.nilai DESC ;

-- ----------------------------
-- View structure for vw_score
-- ----------------------------
DROP VIEW IF EXISTS `vw_score`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `vw_score` AS SELECT a.user_id,a.detail_score_id,b.`name`,COUNT(a.`status`)*5 AS nilai FROM score A
INNER JOIN users B
ON b.id=a.user_id
WHERE a.`status`='benar'
GROUP BY a.detail_score_id ;
